【ロージーローザ BB・CCクリーム専用パフの詳細】<br>
キメ細かなスポンジが、BB・CCクリームをムラなく肌に広げると同時に、適度に余分なクリームを吸収。薄づきで透明感のある肌に仕上げます。<br><br>

【使用方法】<br>
BBクリーム、またはCCクリームをあらかじめお肌に伸ばしてから、パフでトントンと軽くお肌になじませるようにしてご使用ください。<br>
※パフに直接BB：CCクリームをつけて使用する事も出来ますが、クリームの形状によってはパフに吸収されやすい事があります。<br><br>

【ご注意】<br>
○用途以外のご使用はお止めください。<br>
○お肌に合わない場合は、ご使用を中止してください。<br>
○SPF値、PA値の高い商品、エタノールが高配合されている商品をご使用の場合、パフが変形する事があります。<br>
○パフはいつも清潔にしてご使用ください。水分を含ませた後は必ず十分に乾燥させてから保管してください。<br>
○ケースに無理な力を加えると、破ける事がありますので、ご注意ください。<br>
○お子様の手の届かないところに保管してください。また、極端に高温または低温の場所、直射日光の当たる場所、湿度の高い場所を避けて保管してください。<br><br>

【材質】<br>
本体/NBR（合成ゴム）、ポリウレタン、リボン/ポリエステル、ソフトケース/PE<br><br>
【内容量】<br>
2個入り<br><br>

【販売元】<br>
株式会社シャンティ<br>
東京都新宿区市谷本町1-1<br>
お電話：0120-56-1114<br><br>

【商品区分】<br>
化粧品<br><br>

[BB・CCクリーム専用パフ] 

